import React from 'react';
import '../styles/ItemList.css'; // Optional: for styling
import { useNavigate, Link } from 'react-router-dom';

const items = [
  { id: 1, name: 'Plastic Bottles', description: 'Recyclable plastic containers.' },
  { id: 2, name: 'Cardboard Boxes', description: 'Used cardboard packaging.' },
  { id: 3, name: 'Glass Jars', description: 'Clean glass jars and bottles.' },
  { id: 4, name: 'Aluminum Cans', description: 'Empty soda and food cans.' },
];

const ItemList = () => {
  return (
    <div className="item-list-container">
      <h2>Available Items</h2>
      <ul className="item-list">
        {items.map((item) => (
          <li key={item.id} className="item-card">
            <h3>{item.name}</h3>
            <p>{item.description}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ItemList;
